import './sizes.css'
export default function sizes(){
    const sizeList = [
        {
            name:'XS'
        },
        {
            name: 'S'
        },
        {
            name: 'M'
        },
        {
            name: 'L'
        },
        {
            name: 'XL'
        }
    ];

    return(
        sizeList.map((size, key) => 
            <div className="Sizes" key={key}>
                <label>
                    <input type="checkbox" value={size.name}/>
                        <span>{size.name}</span>
                </label>
            </div>
        )
    );
}
